<a class="Title2" id="configuration-d-un-projet-c---en-ligne-de-commande-avec-cmake_configurer-la-commande-make" href="#configuration-d-un-projet-c---en-ligne-de-commande-avec-cmake">Configurer la commande make</a>
</h2><br><span class="GText2" style="
color: #00ff00;
">// build-cmd/make.sh</span><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">MAKE_CMD="$1"
MAKE_ARGS=""
shift
...
while test $# -gt 0
do
    MAKE_ARGS="$MAKE_ARGS $1"
    shift
done
...
make -f commands.mak $MAKE_CMD ARGS="$MAKE_ARGS"</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="configuration-d-un-projet-c---en-ligne-de-commande-avec-cmake_configurer-les-regles-de-construction" href="#configuration-d-un-projet-c---en-ligne-de-commande-avec-cmake">Configurer les règles de construction</a>
</h2><br><span class="GText2" style="
color: #00ff00;
">// build-cmd/commands.mak</span><br><pre class="GCode1 Code1 AceCode" data-mode="makefile" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">SRC_DIR = ..
BUILD_DIR = ../build
TARGET_NAME = ReadyScope
SETUP_NAME = $(BUILD_DIR)/$(TARGET_NAME)
...
all: clean_exe cmake compile run
all_g: clean_exe cmake_g compile run_g
...
cmake:
	@echo
	@cmake -B $(BUILD_DIR) -S $(SRC_DIR)
cmake_g:
	@echo
	@cmake -DCMAKE_BUILD_TYPE=Debug -B $(BUILD_DIR) -S $(SRC_DIR)
compile:
	@echo
	@make -C $(BUILD_DIR)
clean_exe:
	@echo
	@rm -f $(SETUP_NAME)
clean: clean_exe
	@echo
	@make -C $(BUILD_DIR) clean
clean_all:
	@echo
	@rm -rf $(BUILD_DIR)/*
run:
	@echo
	@./envs.sh &amp;&amp; $(SETUP_NAME) $(ARGS)
	@echo
run_g:
	@echo
	@./envs.sh &amp;&amp; gdb --args $(SETUP_NAME) $(ARGS)
	@echo</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="configuration-d-un-projet-c---en-ligne-de-commande-avec-cmake_configurer-le-fichier-de-variables-d-environnement" href="#configuration-d-un-projet-c---en-ligne-de-commande-avec-cmake">Configurer le fichier de variables d'environnement</a>
