    w.show();
    ...
    return a.exec();
}</pre><br><span class="GText2" style="
color: #00ff00;
">// MainWindow.h</span><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">#pragma once
...
#include &lt;QMainWindow&gt;
...
namespace Ui
{
    class MainWindow;
}
...
class MainWindow : public QMainWindow
{
    Q_OBJECT
    ...
public:
    explicit MainWindow(QWidget *parent = nullptr);
    ~MainWindow();
    ...
private:
    Ui::MainWindow *ui;
};</pre><br><span class="GText2" style="
color: #00ff00;
">// MainWindow.cpp</span><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">#include "MainWindow.h"
#include "ui_MainWindow.h"
...
#include &lt;QDebug&gt;
...
MainWindow::MainWindow(QWidget *parent)
    : QMainWindow(parent),
