QString DSettings::escape(const QString &amp;str)
{
    if (str.indexOf("\n") == -1 &amp;&amp; str.indexOf("\a") == -1 &amp;&amp; 
    str.indexOf(";") == -1)
        return str;

    QString escaped(str);
    escaped = escaped.replace("\n", "\\n");
    escaped = escaped.replace("\a", "\\a");
    return "\"" + escaped + "\"";
}
...
void DSettings::setValue(const QString &amp;key, const QString &amp;value)
{
